<script>
	document.addEventListener('keyup', event=>{
    	if (event.ctrlKey) {
        	if (event.keyCode == 221) {
            	
                document.querySelectorAll('textarea, input').forEach(e=>{
                	e.classList.toggle('active');
                    if (e.classList.contains('active')) {
